Storyline

With Po's status as the Dragon Warrior proven to all, Master Shifu has a new challenge for him; teaching Introduction to Kung Fu class to a bunch of a rambunctious bunny children. After getting the class to come to order, Po teaches them that fighting is only part of kung fu, while its true meaning is &quot;Excellence of Self.&quot; To explain this philosophy, Po tells stories of each of his comrades, The Furious Five, and how they faced formative challenges in their youth that helped define them as true masters of kung fu.
